import { Link } from "react-router-dom";
import { Button } from "@mui/material";

const Loginnaga = () => {
  return (
    <>
      <h1>ログイン画面</h1> 
      <Button
       variant="contained"
       color="primary"
       component={Link} to="/menu">
        Go to Menu!
      </Button>
    </>
  );
};

export default Loginnaga;
